import React, { Component } from 'react';
import './App.css'

class App extends Component {
  constructor(props) {
    super(props)
      this.state = {
        currentPosition: "",
        bodyPlacementOptions: ["🖐🏻", "🤚🏻", "R🦶🏻", "L🦶🏻"],
        colorOptions: ["🔴", "🔵", "🟢"]
      }
  }
}
